package com.wanding.face.bean;

import java.io.Serializable;

/**
 * 获取authinfo返回实体
 */
public class AuthInfoResData implements Serializable {

    private String return_code;//": "SUCCESS",
    private String return_msg;//": "请求成功",
    private String nonce_str;//: "dCakS2gVAOPvhDxb5cY38cHhDN4zwbts",
    private String sign;//: "CB1F939A25CD06EBD96D38D8253AB2D7",
    private String appid;//: "wx2cc486f43753d093",
    private String mch_id;//: "1484397842",
    private String sub_appid;//: "",
    private String sub_mch_id;//: "1490359152",
    private String store_id;//: "10000001",
    private String authinfo;//: "",
    private String expires_in;//: "3600"

    public AuthInfoResData() {

    }

    public String getReturn_code() {
        return return_code;
    }

    public void setReturn_code(String return_code) {
        this.return_code = return_code;
    }

    public String getReturn_msg() {
        return return_msg;
    }

    public void setReturn_msg(String return_msg) {
        this.return_msg = return_msg;
    }

    public String getNonce_str() {
        return nonce_str;
    }

    public void setNonce_str(String nonce_str) {
        this.nonce_str = nonce_str;
    }

    public String getSign() {
        return sign;
    }

    public void setSign(String sign) {
        this.sign = sign;
    }

    public String getAppid() {
        return appid;
    }

    public void setAppid(String appid) {
        this.appid = appid;
    }

    public String getMch_id() {
        return mch_id;
    }

    public void setMch_id(String mch_id) {
        this.mch_id = mch_id;
    }

    public String getSub_appid() {
        return sub_appid;
    }

    public void setSub_appid(String sub_appid) {
        this.sub_appid = sub_appid;
    }

    public String getSub_mch_id() {
        return sub_mch_id;
    }

    public void setSub_mch_id(String sub_mch_id) {
        this.sub_mch_id = sub_mch_id;
    }

    public String getStore_id() {
        return store_id;
    }

    public void setStore_id(String store_id) {
        this.store_id = store_id;
    }

    public String getAuthinfo() {
        return authinfo;
    }

    public void setAuthinfo(String authinfo) {
        this.authinfo = authinfo;
    }

    public String getExpires_in() {
        return expires_in;
    }

    public void setExpires_in(String expires_in) {
        this.expires_in = expires_in;
    }
}
